import { t } from 'i18next';
import './searchitem.css'

export default function SearchItem(props) {
    let url = "#";

    return (
        <div onClick={() => props.clickHandler()}>
            <a href={url}>
                {props.menuOption==="search"?t('appPageTexts.part5'):t('appPageTexts.part6')}
            </a>
        </div>
    );
}
